Verpleegkundige interventies is de Nederlandse vertaling van Nursing Interventions Classification (NIC). Deze app is gebaseerd op de vierde, herziene Nederlandse editie die weer een vertaling is van de zesde Amerikaanse druk. 

De app biedt een gestructureerde indeling van verpleegkundige diagnoses en interventies. De belangrijkste kenmerken van de NIC zijn:
•	volledigheid: meer dan 550 interventies, waarvan 23 geheel nieuwe en 133 herziene interventies;
•	evidence-based;
•	vanuit de bestaande praktijk ontwikkeld;
•	weerspiegelt de actuele klinische praktijk en recent onderzoek;
•	duidelijke en klinisch zinvolle terminologie;
•	in het veld getoetst;
•	gecombineerd met de NANDA-diagnoses ( 2012-2014 NANDA-I).

Verpleegkundige interventies draagt bij tot adequaat onderwijs in de klinische besluitvorming. De app voorziet in standaardisering en definiëring van de benodigde kennis voor verpleegkundig onderwijs en de verpleegkundige praktijk. Tevens is het een hulpmiddel bij de ontwikkeling van leerplannen, die daardoor beter aansluiten op de praktijk.

Verpleegkundige interventies is primair bedoeld voor verpleegkundigen. Zij kunnen met deze app een keuze maken uit mogelijke interventies. Daarnaast kan de app een hulpmiddel zijn bij de communicatie over behandelingen met andere zorgverleners.

Verpleegkundige zorgresultaten is de Nederlandse vertaling van Nursing Outcomes Classification (NOC). Deze app is gebaseerd op de derde, herziene Nederlandse editie die weer een vertaling is van de vijfde Amerikaanse druk.

De app biedt een gestructureerde indeling van verpleegkundige diagnoses en zorgresultaten. De belangrijkste kenmerken van de NOC zijn:
• volledigheid: 490 geactualiseerde zorgresultaten, waarvan 107 geheel nieuwe;
• evidence-based;
• duidelijke en klinisch zinvolle terminologie;
• gebruiksvriendelijke structuur;
• toepasbaar in verschillende disciplines;
• getoetst in het veld;
• gecombineerd met de NANDA-diagnoses (2012-2014 NANDA-I).

Verpleegkundige zorgresultaten draagt bij tot adequaat onderwijs in de klinische besluitvorming. De app voorziet in standaardisering en definiëring van de benodigde kennis voor verpleegkundig onderwijs en de verpleegkundige praktijk. Tevens is het een hulpmiddel om leerplannen beter te laten aansluiten op de praktijk.

Feeling run down with everyday stresses? Pressure points are a great way to release nerve endings and ease tension in the body for all over spiritual and physical comfort. You can also use self-massage of points to relieve anxiety and to help you get to sleep at night.
"Acupressure: Heal Yourself" is easy to use app with illustrated instructions how to make point massage, completely offline, does not require Internet connection. 
Acupressure is an ancient healing art that uses the fingers to press key points on the surface of the skin to stimulate the body's natural self-curative abilities. When these points are pressed, they release muscular tension and promote the circulation of blood and the body's life force to aid healing. 
Foremost among the advantages of acupressure's healing touch is that it is safe to do on yourself and others - even if you've never done it before. You can also use self-acupressure to relieve anxiety and to help you get to sleep at night.
App contains over 90 points combinations to be used in different situations e.g. to relief the headache, to give up smoking, to reduce high blood pressure etc. 
All the combinations are present in the following groups:
•Maintaining health;
•Emergencies;
•Stop addictions;
•Pain relief;
•Sense organs disorders;
•Circulatory disorders;
•Digestive disorders;
•Respiratory disorders;
•Urinary disorders;
•Reproductive disorders;
•Other common disorders.
