"Anatomy Quiz" is a quiz which invites you to test your knowledge of human anatomy. It may be used for testing and educational purposes for people well-informed about the anatomy. Game consists of 150 illustrated questions from the following areas:
 - Digestion and Respiration; 
- Parts of Eye; 
- Parts of Brain; 
- Parts of Heart; 
- Muscles; 
- Skeleton; 
- Head and Neck; 
- Bones of Hand; 
- Bones of Foot; 
- Vertebral Column and Ribs; 
- Palate; 
- Teeth; 
- Abdomen and Pelvis.
Each question has 4 possible answers. When you tap one of the answers, the default border color of the pressed button is changed to green (when it was the right answer) or to red (wrong answer). You have 3 attempts to give right answer.  If you give it at the first attempt you will receive 3 points, at the second attempt - 2 points, at the third - 1 point. Play the "Anatomy Quiz" quiz now to test and improve your knowledge of the human anatomy!
